import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          id: "1",
          name: "Virendra",
        },
        {
          id: "2",
          name: "Vishal",
        },
        {
          id: "3",
          name: "Aniketh",
        },
        {
          id: "4",
          name: "Muragesh",
        },
        {
          id: "5",
          name: "Shashank",
        },
      ],
    };
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((response) => {
        response.json();
      })
      .then((users) =>
        this.setState(
          () => {
            return { monsters: users };
          },
          () => {
            console.log(users);
          }
        )
      );
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((moster) => {
          return (
            <div key={moster.id}>
              <h1>{moster.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
